import React from "react";
import Logo from "/assets/logo/Logo-brainflix.svg";

const Header = () => {
    return (
        <div className="header">
            <div><img src={Logo} alt="BrainFlix Logo"/>BrainFlix</div>
            <form className="searchBar">
            <input type="text" className="searchBar__input" placeholder="Search"><img src="/assets/icons/SVG/Icon-search.svg"/></input>
            <button type="button" className="button uploadButton"><img src="/assets/icons/Icon-upload.svg"/>UPLOAD</button>
            </form>
        </div>
    );
  }
  export default Header;
